llm_output:
function showBacking(uint256 accuracy) public view returns (uint256) {
    uint256 totalSupplyValue = totalSupply();
    uint256 backingValue = address(this).balance;
    require(backingValue <= totalSupplyValue, "SafeMath: subtraction overflow");
    return (backingValue * accuracy) / totalSupplyValue;
}

